import React, {Component} from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
import './Map.css'

export class MapContainer extends Component {

    onMarkerClick = (props, marker, e) =>
    this.setState({
      selectedPlace: props,
      activeMarker: marker,
      showingInfoWindow: true
    });

render() {

    return (

        <Map
          google={this.props.google}
          zoom={18}
          initialCenter={{ lat: 40.7084, lng: -73.9383}}
        >
             <Marker position={{ lat: 40.7084, lng: -73.9383}} onClick={this.onMarkerClick}
          name={'3 Dollar Bill'} address={'260 Meserole St, Brooklyn, NY 11206'}/>

             </Map>

    );
  }
}
  export default GoogleApiWrapper({
    apiKey: 'AIzaSyDXcgW7UOSSEMMj7jTCTeznp6qq98LeZus'
  })(MapContainer);
